import React from 'react';

const PopupsPlayer = ({ player }) => {
    // Function to replace null with "Null"
    const displayValue = (value) => {
        return value === null ? 'Null' : value;
    };

    return (
        <div className="popup-container" style={{ maxHeight: '400px', overflowY: 'auto' }}>

            <h2>'{displayValue(player.PlayerName)}' Info</h2>
            <div style={{ display: "flex", justifyContent: "space-between" }}>
                <div>
                    <h2>General Info</h2>
                    <p><strong>Age</strong> {displayValue(player.PlayerAge)}</p>
                    <p><strong>Role</strong> {displayValue(player.PlayerRole)}</p>
                    <p><strong>Team</strong> {displayValue(player.PlayerTeam)}</p>
                </div>
                <div>  
                    <h2>Batting Stats</h2>
                    <p><strong>Matches</strong> {displayValue(player.PlayerMatches)}</p>
                    <p><strong>Runs</strong> {displayValue(player.PlayerRuns)}</p>
                    <p><strong>Batting Average</strong> {displayValue(player.BatAvg)}</p>
                    <p><strong>Batting Style</strong> {displayValue(player.BatStyle)}</p>
                    <p><strong>Highest Score</strong> {displayValue(player.HighestScore)}</p>
                    <p><strong>Bat Innings</strong> {displayValue(player._BatInnings)}</p>
                    <p><strong>Batting Strike Rate</strong> {displayValue(player._BatSR)}</p>
                    <p><strong>Hundreds</strong> {displayValue(player._Hundreds)}</p>
                    <p><strong>Fifties</strong> {displayValue(player._Fifties)}</p>
                {/* </div>
                <div> */}
                    <h2>Bowling Stats</h2>
                    <p><strong>Bowling Average</strong> {displayValue(player._BowlAvg)}</p>
                    <p><strong>Bowling Style</strong> {displayValue(player._BowlStyle)}</p>
                    <p><strong>Bowl Runs</strong> {displayValue(player._BowlRuns)}</p>
                    <p><strong>Best Bowling Figure</strong> {displayValue(player._BBF)}</p>
                    <p><strong>Bowl Innings</strong> {displayValue(player._BowlInnings)}</p>
                    <p><strong>Bowling Strike Rate</strong> {displayValue(player._BowlSR)}</p>
                    <p><strong>Five Wicket Haul</strong> {displayValue(player._FiveWickets)}</p>
                    <p><strong>Ten Wicket Haul</strong> {displayValue(player._TenWickets)}</p>
                </div>
            </div>
        </div>
    );
};

export default PopupsPlayer;
